import React, { useContext } from "react";
import  { useState } from "react";
import { createUserWithEmailAndPassword,signOut } from "firebase/auth";
import { auth } from "../firebase/firebase-config";
import { GlobalContext } from "../Context/GlobalContext";

function SignupForm(props){
 const auth=useContext(GlobalContext).auth
 

    return (
        <form action="" onClick={(e)=>{
e.preventDefault()
        }}>
        <div className="form">
           
        <h4>
            Sign Up
        </h4>
       
        <label>Your Email</label>
        <br />
        <input type="email" onChange={(e)=>{
            authorize?.setRegEmail(e.target.value)

        }}/>
        <label>Your Password</label>
        <br />
        <input type="password"  onChange={(e)=>{
            auth?.setRegPass(e.target.value) 
        } } placeholder="enter your pass" autoComplete="on"/>
        <br /><br />
        <button onClick={authorize?.register}>Create account</button>
         <br />
        <p onClick={()=>{
            props.chgForm()
        }}>Login with existing account</p>

    </div>
    </form>

    

    )
}
export default SignupForm
